    class RequestProcessor {
        
        constructor() {
            this.uriPatterns = []
        }
        
        isValidProcessor(httpRequest) {
            for (let pattern of this.uriPatterns) {
                if (httpRequest.url.match(pattern)) {
                    return true;
                }
            }
            return false;
        }
    }
    
